import { useState } from "react";
import { Router, Routes, useNavigate, Navigate } from "react-router-dom";
import "./App.css";
import {
  AddContact,
  Contact,
  Contacts,
  EditContact,
  SearchContact,
  ViewContact,
  Navbar,
  Spinner,
} from "./components/index";

const App = () => {
  const [getContacts, setContacts] = useState([]);
  const [getLoading, setLoading] = useState(false);
  return (
    <div className="App">
      <Navbar />
      <Contacts contacts={getContacts} loading={getLoading} />
    </div>
  );
};

export default App;
